(1, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'Site', '<p>Here you can update the site related settings.</p>\r\n<p>You can update the informations like Site Name, Site Slogan, Site Currenct, Site language.</p>\r\n<p>You can also change the PayPal currency code here. To know more about PayPal supported currency codes visit <a target="_blank" href="https://cms.paypal.com/us/cgi-bin/?cmd=_render-content&content_ID=developer/e_howto_api_nvp_currency_codes">PayPal Currency Codes</a>'),
(2, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'Meta', '<p>Meta element is used to provide information that is relevant to browsers or search engines like describing the content of your document.</p>\r\n'),
(3, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'Product', '<p>Here you can update product related settings.</p>'),
(4, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'Comment API', '<p>Here you can update the Comment API code.</p>'),
(5, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'Images', '<p>Here you can update the dimension (Width x Height) of the images.</p>\r\n'),
(6, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'Product Photo', NULL),
(9, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'Facebook', '<p>Here you can update facebook related settings. </p>\r\n<p>Facebook Application keys:</p>\r\n<p>Create Facebook Application by login to site <a href="http://www.facebook.com/developers/" target="_blank">http://www.facebook.com/developers/</a>.</p>'),
(10, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'Twitter', '<p>You can change the twitter ''oAuth'' related settings here. oAuth is used to post a message in twitter when a new gig is added.</p><p> Refer, <a href="http://apiwiki.twitter.com/FAQ#WhenwillTwittersupportOAuth" target="_blank">http://apiwiki.twitter.com/FAQ#WhenwillTwittersupportOAuth</a> and <a href="http://apiwiki.twitter.com/FAQ#HowdoIget%E2%80%9CfromMyApp%E2%80%9DappendedtoupdatessentfrommyAPIapplication" target="_blank" >http://apiwiki.twitter.com/FAQ#HowdoIget%E2%80%9CfromMyApp%E2%80%9DappendedtoupdatessentfrommyAPIapplication</a>.</p>\r\n<p>We need to create a new application in twitter with this url <a href="http://twitter.com/apps/new" target="_blank">http://twitter.com/apps/new</a>.</p>\r\n<p>To get Twitter widget code refer <a href="http://twitter.com/goodies/widgets" target="_blank">http://twitter.com/goodies/widgets</a>.</p>\r\n<p>Twitter callback url http://sitename/users/oauth_callback (note : use site url here).</p>'),
(11, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'QR Code', NULL);
